trailingComments.value:
*
 * 打开统计页面
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<*>}
 *
 * @example
 * libSQ.exec('open-talk-detail-page', { params: { talkId: '285' } }).catch((err) => {
 *   alert(`[open-talk-detail-page][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });

